import React from 'react';
import { TouchableOpacity, View, StyleSheet } from 'react-native';

const HamburgerButton = ({ onPress, style, lineStyle, backgroundColor = '#F9BB55' }) => {
  return (
    <TouchableOpacity
      style={[styles.menuButton, { backgroundColor }, style]}
      onPress={onPress}
    >
      <View style={[styles.menuLine, lineStyle]} />
      <View style={[styles.menuLine, lineStyle]} />
      <View style={[styles.menuLine, lineStyle]} />
    </TouchableOpacity>
  );
};

const styles = StyleSheet.create({
  menuButton: {
    width: 32,
    height: 24,
    justifyContent: 'space-between',
    paddingHorizontal: 6,
    paddingVertical: 3,
    borderRadius: 6,
    alignItems: 'center',
  },
  menuLine: {
    height: 3,
    backgroundColor: '#000',
    borderRadius: 2,
    width: '100%',
  },
});

export default HamburgerButton;
